INSERT INTO `ejl_help` VALUES (1, '如何与家庭成员语音聊天', '进入到聊天群组或者点击用户头像进入用户个人资料界面点击聊天，按住“按住说话”按钮，然后就可以开始说话；说话完毕后松开按钮，语音就会发生出去', '如何与家庭成员语音聊天', NULL, '', -1, SYSDATE(), NULL, NULL);
INSERT INTO `ejl_help` VALUES (2, '如何创建聊天群', '点击“聊天”标签进入到聊天主界面，点击右上角的“+”按钮，然后选择要聊天的用户，点击确定按钮即可', '如何创建聊天群', NULL, '', NULL, NULL, NULL, NULL);
INSERT INTO `ejl_help` VALUES (3, '如何在聊天群中发送图片', '在聊天界面点击右边的图片图标可以选择拍照或者从手机相册中选择图片，选择图片之后点击“完成”按钮即可', '如何在聊天群中发送图片', NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `ejl_help` VALUES (4, '家庭好友和好友的区别', '好友列表中的好友是用户手机通讯录中已经注册了亿家联app的用户的手机号，默认添加为好友；家庭好友是跟用户在一个家庭的好友，家庭好友是包含在好友中，只是需要跟手机用户在一个家庭中', '家庭好友和好友的区别', NULL, NULL, -1, SYSDATE(), NULL, NULL);
INSERT INTO `ejl_help` VALUES (5, '为什么有些好友删除不了', '因为有些好友是从用户的手机通讯录中获取，只要该好友还在用户的手机通讯录中，该好友是会默认在用户的好友列表中', '为什么有些好友删除不了', NULL, NULL,-1, SYSDATE(), NULL, NULL);
INSERT INTO `ejl_help` VALUES (6, '如何申请加入家庭', '点击“通讯录”，再点击“家庭”标签，然后点击右上角的图标，选择申请家庭，在出现的申请家庭界面输入家庭号，点击“申请”按钮等待对方同意即可', '如何申请加入家庭', NULL, NULL, -1, SYSDATE(), NULL, NULL);
INSERT INTO `ejl_help` VALUES (7, '家庭如何邀请成员', '点击“通讯录”，再点击“家庭”标签，然后点击右上角的图标，选择邀请家庭成员，输入要邀请的用户的手机号，点击邀请，等待对方同意邀请即可', '家庭如何邀请成员', NULL, NULL, -1, SYSDATE(), NULL, NULL);
INSERT INTO `ejl_help` VALUES (8, '如何查看手表的健康数据', '点击“健康”标签进入健康管理页面，点击“步行累计”和“心率数据”即可查看步行累计数据和心率数据', '如何查看手表的健康数据', NULL, NULL, -1, SYSDATE(), NULL, NULL);
INSERT INTO `ejl_help` VALUES (9, '如何设定手表的健康目标', '点击“健康”标签进入健康管理页面，点击更改目标，即可设置手表的健康目标', '如何设定手表的健康目标', NULL, NULL,  -1, SYSDATE(),NULL, NULL);
